import { useRef } from 'react'

function RegisterSource() {
  const courses = [
    {
      id: 1,
      name: 'Mathematics',
      code: 'MATH101',
      credits: 3,
      enrolled: 30,
      status: 'Open',
    },
    {
      id: 2,
      name: 'Physics',
      code: 'PHYS101',
      credits: 4,
      enrolled: 25,
      status: 'Open',
    },
    {
      id: 3,
      name: 'Chemistry',
      code: 'CHEM101',
      credits: 3,
      enrolled: 20,
      status: 'Closed',
    },
    {
      id: 4,
      name: 'Biology',
      code: 'BIO101',
      credits: 3,
      enrolled: 15,
      status: 'Open',
    },
    {
      id: 5,
      name: 'Computer Science',
      code: 'CS101',
      credits: 4,
      enrolled: 40,
      status: 'Closed',
    },
  ]
  return (
    <div
      style={{
        flex: 1,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column',
      }}
    >
      <span
        style={{
          color: 'black',
          fontSize: 20,
          fontWeight: 'bold',
          marginBottom: 20,
          marginTop: 20,
        }}
      >
        Đăng kí học phần
      </span>
    </div>
  )
}
export default RegisterSource
